/* BUTTON - JS */

import React from "react";
import { NavLink } from "react-router-dom";
import './style.css';



export default function Button({}) {

  function clickMe() {
    alert("You're clicked me !");
  }

  return (
    <button onClick={clickMe}>Button</button>
  )
  
  
}
